<div style="display: flex; justify-content: center; align-items: center; width: 300px; height: 300px; margin: auto">
  <svg
    xmlns="http://www.w3.org/2000/svg"
    xmlns:xlink="http://www.w3.org/1999/xlink"
    id="Layer_1"
    version="1.1"
    viewBox="0 0 800 800"
    style="position: relative; width: 300px; height: 300px"
  >
    <defs>
      <style>
        .st0 {
          fill: #fff;
        }

        .st1 {
          fill: #023;
        }

        .wrapper {
          position: relative;
          width: 300px;
          /* ajuste conforme necessário */
          height: 200px;
          margin: 0 auto;
          overflow: visible;
        }

        /* === Duas camadas empilhadas === */
        .sequence {
          position: absolute;
          inset: 0;
          display: flex;
          align-items: center;
          justify-content: center;
          pointer-events: none;
          transform-origin: center center;
        }

        /* A camada rotacionada já inicia girada e levemente ajustada */
        .sequence.rotated {
          transform: rotate(180deg);
          transform-box: fill-box;
          transform-origin: center center;
          position: absolute;
          inset: 0;
          display: flex;
          align-items: center;
          justify-content: center;
        }

        /* === Alternância entre camadas === */
        @keyframes normalLayerVisibility {
          0%,
          49.999% {
            opacity: 1;
          }

          50%,
          100% {
            opacity: 0;
          }
        }

        @keyframes rotatedLayerVisibility {
          0%,
          49.999% {
            opacity: 0;
          }

          50%,
          100% {
            opacity: 1;
          }
        }

        .sequence.normal {
          animation: normalLayerVisibility 2s steps(1) infinite;
        }

        .sequence.rotated {
          animation: rotatedLayerVisibility 2s steps(1) infinite;
        }

        /* === Frames de brilho/opacidade (16 → 7, 7 → 16) === */
        /* Transições suaves com crossfade ampliado */

        @keyframes frame16 {
          0%,
          4.5% {
            opacity: 1;
          }
          6%,
          92.5% {
            opacity: 0;
          }
          94%,
          100% {
            opacity: 1;
          }
        }

        /* FRAME 15: ida 6.25..12.5 ; volta 87.5..93.75 */
        @keyframes frame15 {
          0%,
          5% {
            opacity: 0;
          }
          6.5%,
          11% {
            opacity: 1;
          }
          12.5%,
          86% {
            opacity: 0;
          }
          87.5%,
          92.5% {
            opacity: 1;
          }
          94%,
          100% {
            opacity: 0;
          }
        }

        /* FRAME 14: ida 12.5..18.75 ; volta 81.25..87.5 */
        @keyframes frame14 {
          0%,
          11% {
            opacity: 0;
          }
          12.5%,
          17.5% {
            opacity: 1;
          }
          19%,
          79.5% {
            opacity: 0;
          }
          81%,
          86.5% {
            opacity: 1;
          }
          88%,
          100% {
            opacity: 0;
          }
        }

        /* FRAME 13: ida 18.75..25 ; volta 75..81.25 */
        @keyframes frame13 {
          0%,
          17.5% {
            opacity: 0;
          }
          19%,
          24% {
            opacity: 1;
          }
          25.5%,
          73.5% {
            opacity: 0;
          }
          75%,
          80.5% {
            opacity: 1;
          }
          82%,
          100% {
            opacity: 0;
          }
        }

        /* FRAME 12: ida 25..31.25 ; volta 68.75..75 */
        @keyframes frame12 {
          0%,
          24% {
            opacity: 0;
          }
          25.5%,
          30% {
            opacity: 1;
          }
          31.5%,
          67.5% {
            opacity: 0;
          }
          69%,
          74% {
            opacity: 1;
          }
          75.5%,
          100% {
            opacity: 0;
          }
        }

        /* FRAME 11: ida 31.25..37.5 ; volta 62.5..68.75 */
        @keyframes frame11 {
          0%,
          30% {
            opacity: 0;
          }
          31.5%,
          36.5% {
            opacity: 1;
          }
          38%,
          61.5% {
            opacity: 0;
          }
          63%,
          68% {
            opacity: 1;
          }
          69.5%,
          100% {
            opacity: 0;
          }
        }

        /* FRAME 10: ida 37.5..43.75 ; volta 56.25..62.5 */
        @keyframes frame10 {
          0%,
          36.5% {
            opacity: 0;
          }
          38%,
          43% {
            opacity: 1;
          }
          44.5%,
          55% {
            opacity: 0;
          }
          56.5%,
          61.5% {
            opacity: 1;
          }
          63%,
          100% {
            opacity: 0;
          }
        }

        /* FRAME 9: ida 43.75..50 ; volta 50..56.25 */
        @keyframes frame9 {
          0%,
          43% {
            opacity: 0;
          }
          44.5%,
          49% {
            opacity: 1;
          }
          50.5%,
          50.5% {
            opacity: 0;
          }
          51%,
          55.5% {
            opacity: 1;
          }
          57%,
          100% {
            opacity: 0;
          }
        }

        /* === Aplicação das animações === */
        #frame16 {
          animation: frame16 2s ease-in-out infinite;
          display: block;
        }

        #frame15 {
          animation: frame15 2s ease-in-out infinite;
          display: block;
        }

        #frame14 {
          animation: frame14 2s ease-in-out infinite;
          display: block;
        }

        #frame13 {
          animation: frame13 2s ease-in-out infinite;
          display: block;
        }

        #frame12 {
          animation: frame12 2s ease-in-out infinite;
          display: block;
        }

        #frame11 {
          animation: frame11 2s ease-in-out infinite;
          display: block;
        }

        #frame10 {
          animation: frame10 2s ease-in-out infinite;
          display: block;
        }

        #frame9 {
          animation: frame9 2s ease-in-out infinite;
          display: block;
        }

        #frame8 {
          animation: frame8 2s ease-in-out infinite;
          display: block;
        }

        #frame7 {
          animation: frame7 2s ease-in-out infinite;
          display: block;
        }

        /* === Imagens === */
        .wrapper image {
          max-width: 100%;
          max-height: 100%;
          display: block;
          position: relative;
        }

        .frame {
          opacity: 0;
        }

        image {
          width: 512px;
          height: 512px;
          transform: translate(130px, 130px);
        }
      </style>
    </defs>
